import React from 'react'
import '../CSS/Button.css';

const Button = (props) => {
    return (
        <>
            <label class="switch" onChange = {props.handle}>
                <input type="checkbox" />
                <span class="slider round"></span>
            </label>
        </>
    )
}
export default Button;
